import React from 'react';

function Heading () {
    return (
        <Video></Video>
    )
}

function Video () {
    return (
        <>
        <video style={vid} autoPlay loop muted>
            <source src="video.mp4" type="video/mp4"></source>
        </video>
        </>
    )
}


const vid = {
    // width : '100%',
    // height : '100vh',
    position : 'absolute',
    top : '0',
    left : '0'
}

export default Heading;
